import React from 'react'
import panner1 from '../images/panner1.jpg'
import panner2 from '../images/panner2.jpg'
import Slider from "react-slick";

export default function Home() {

    const settings = {
        slidesToShow: 2,
        slidesToScroll: 1,
        autoplay: true,
        autoplaySpeed: 1500,
        arrows: false,
        dots: false,
        pauseOnHover:false,
        responsive: [{
            breakpoint: 768,
            setting: {
                slidesToShow:4
            }
        }, {
            breakpoint: 520,
            setting: {
                slidesToShow: 3
            }
        }]
      };

    return (
        <>
            <div className='slider-container'>
                <Slider {...settings}>
                    <div className="slide"><img src={panner1} alt="logo" /></div>
                    <div className="slide"><img src={panner2} alt="logo" /></div>
                </Slider>
            </div>
        </>
    )
}
